enum AppVideoProvider { YouTube }class AppVideo {  final String id;  final String title;  final String url;  final String? uploader;  final String? thumbnail;  final DateTime? publishedAt;  String? publishedAtStr;  final String? description;  final AppVideoProvider provider;  double? width;  double? height;  bool? isVertical;  AppVideo(      {required this.title,      required this.id,      required this.url,      this.uploader,      this.thumbnail,      this.publishedAt,      this.publishedAtStr,      required this.provider,      this.width,      this.height,      this.description}) {    if (this.publishedAtStr == null || this.publishedAtStr == "Unknown") {      this.publishedAtStr = this.publishedAt?.toString();    }    if (this.width != null && this.height != null) {      this.isVertical = this.height! >= this.width!;    }  }  @override  String toString() {    return 'ID: $id , Title: $title, Uploader: $uploader, Published At: $publishedAtStr, width: ${this.width.toString()} and height: ${this.height.toString()}';  }}